import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import { useState } from "react";
import Carousel from "react-bootstrap/Carousel";
import Casa from "../img/Casa.jpg";
import Telefoni from "../img/telefoni.jpg";
import Uomo from "../img/retemobile.jpg";

const HomePage = () => {
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex) => {
    setIndex(selectedIndex);
  };
  return (
    <>
      <Navbar collapseOnSelect expand="lg" className="bg-body-tertiary">
        <Container>
          <Navbar.Brand href="#home">FlySim</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#features">Dove Siamo ?</Nav.Link>
              <Nav.Link href="#pricing">Perchè scegliere noi ? </Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link href="#deets">Login</Nav.Link>
              <Nav.Link eventKey={2} href="#memes">
                Registrati
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Carousel activeIndex={index} onSelect={handleSelect}>
        <Carousel.Item>
          <img className="d-block w-100" src={Casa} alt="first-slide" style={{ height: "500px", objectFit: "cover" }} />
          <Carousel.Caption>
            <h3 className="">Rete Fissa</h3>
            <p>Tutta la velocità della fibra , ad un prezzo accessibile</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Uomo} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3>Rete Mobile</h3>
            <p>Lo sapevi il nostro servizio 5G è differente vieni a scoprirlo</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Telefoni} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3>Scegli il telefono che fa per te </h3>
            <p>IPHONE , SAMSUNG , XIAOMI e molti altri ancora scelti per te</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </>
  );
};

export default HomePage;
